webpackJsonp([0x639c41cfef3f],{345:function(A,a){A.exports={data:{project:{html:'<p>I created a smart mirror for my apartment. This display hangs in my apartment and displays information useful at a glance--current time and date, the day\'s weather forecast, personal calendar events, nearby subway times, Citibike dock availability, and daily scheduled reminders.</p>\n<h4>V1 (2016)</h4>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/mirror-v1-a7284f89a91310f08b139a96f5ae28c1-8576a.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 100%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Mirror V1"\n        title=""\n        src="/static/mirror-v1-a7284f89a91310f08b139a96f5ae28c1-893a4.jpg"\n        srcset="/static/mirror-v1-a7284f89a91310f08b139a96f5ae28c1-bbf57.jpg 200w,\n/static/mirror-v1-a7284f89a91310f08b139a96f5ae28c1-260b8.jpg 400w,\n/static/mirror-v1-a7284f89a91310f08b139a96f5ae28c1-893a4.jpg 800w,\n/static/mirror-v1-a7284f89a91310f08b139a96f5ae28c1-25965.jpg 1200w,\n/static/mirror-v1-a7284f89a91310f08b139a96f5ae28c1-e54c8.jpg 1600w,\n/static/mirror-v1-a7284f89a91310f08b139a96f5ae28c1-7c0ed.jpg 2400w,\n/static/mirror-v1-a7284f89a91310f08b139a96f5ae28c1-8576a.jpg 3024w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>I created the first non-interactive prototype using an old Dell netbook, plastic two-way mirror, and a custom-made wooden frame.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/mirror-v1-inside-0eaa8cef006b753e1620c0bd72638f9c-8576a.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Mirror V1 Inside"\n        title=""\n        src="/static/mirror-v1-inside-0eaa8cef006b753e1620c0bd72638f9c-893a4.jpg"\n        srcset="/static/mirror-v1-inside-0eaa8cef006b753e1620c0bd72638f9c-bbf57.jpg 200w,\n/static/mirror-v1-inside-0eaa8cef006b753e1620c0bd72638f9c-260b8.jpg 400w,\n/static/mirror-v1-inside-0eaa8cef006b753e1620c0bd72638f9c-893a4.jpg 800w,\n/static/mirror-v1-inside-0eaa8cef006b753e1620c0bd72638f9c-25965.jpg 1200w,\n/static/mirror-v1-inside-0eaa8cef006b753e1620c0bd72638f9c-e54c8.jpg 1600w,\n/static/mirror-v1-inside-0eaa8cef006b753e1620c0bd72638f9c-7c0ed.jpg 2400w,\n/static/mirror-v1-inside-0eaa8cef006b753e1620c0bd72638f9c-8576a.jpg 3024w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>The software ran a Node.js server on the backend and a React.js front-end. Glancing at it while getting ready quickly became a part of my morning routine.</p>\n<h4>V2 (2018)</h4>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/mirror-v2-435b0261a3d3d90045f727b2253d5cb6-8576a.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Mirror V2"\n        title=""\n        src="/static/mirror-v2-435b0261a3d3d90045f727b2253d5cb6-893a4.jpg"\n        srcset="/static/mirror-v2-435b0261a3d3d90045f727b2253d5cb6-bbf57.jpg 200w,\n/static/mirror-v2-435b0261a3d3d90045f727b2253d5cb6-260b8.jpg 400w,\n/static/mirror-v2-435b0261a3d3d90045f727b2253d5cb6-893a4.jpg 800w,\n/static/mirror-v2-435b0261a3d3d90045f727b2253d5cb6-25965.jpg 1200w,\n/static/mirror-v2-435b0261a3d3d90045f727b2253d5cb6-e54c8.jpg 1600w,\n/static/mirror-v2-435b0261a3d3d90045f727b2253d5cb6-7c0ed.jpg 2400w,\n/static/mirror-v2-435b0261a3d3d90045f727b2253d5cb6-8576a.jpg 3024w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>The newest version is interactive via voice recognition (albeit a very crude version of it, currently). It is an Electron app running on Raspberry Pi that also utilizes React.js for the UI and has a much larger 1080p display.</p>',frontmatter:{title:"Mirror",link:null,tags:null,github:"https://github.com/aamaliaa/mirror",image:null,created:"February 2018"}}},pathContext:{slug:"/projects/mirror/"}}}});
